import React, { Component } from "react";
import axios from "axios";
import "./style/Home.css";
import svg from "./svg-sources";
//import { Link } from "react-router-dom";

const server = "http://localhost:5000/api";

export default class Home extends Component {
  /* constructor(props) {
    super(props);

    this.state = {
      loginStats: false,
    };
  } */

  componentDidMount() {
    axios
      .get(`${server}/checkLogin`)
      .then((res) => {
        console.log(res.data);
        if (!res.data.login) {
          console.log("generate token");
          axios.post(`${server}/generateGuestToken`).then((res) => {
            console.log(res.data);
          });
        }
      })
      .catch((err) => console.log(err));
  }

  render() {
    return (
      <div>
        <div id="Welcome-container">
          <div id="welcome-content">
            <h3 id="hello">Hello,</h3>
            <p id="name">My Name is Rizky Saputra</p>
          </div>
        </div>

        <div id="profile-container">
          <div id="and-container">
            <p id="and">And . . .</p>
          </div>
          <div id="I-container">
            <h1>I</h1>
          </div>
          <div>
            <p>Am 24 Years Old</p>
            <p>Have graduated from university of Lampung</p>
            <p>in Electrical Engineering</p>
            <p>Live in Lampung Province</p>
            <p>Love Computer programming</p>
          </div>
        </div>

        <h3>Hope we can work together</h3>
        <div id="contacts">
          <h6>Contact me</h6>
          <ul>
            <li>Email: rizkysaputra000@gmail.com</li>
            <li>Phone: 082186326036</li>
            <li>WA: 082186326036</li>
            <li>Github: https://github.com/rizkysaputra4/</li>
          </ul>
        </div>
      </div>
    );
  }
}
